import React from 'react';
import {    makeStyles } from '@material-ui/core/styles';
import SearchInput from '../component/SearchInput';
import DataTableUser from '../component/DataTableUser';
import axios from 'axios';
import {BASE_API} from '../constant/index';
const useStyles = makeStyles((theme) => ({
    title:{
        paddingTop:'10px'

    }


}));

export default function User() {
    const classes = useStyles();
      const token = document.cookie;

    const token1 = token.slice(token.indexOf("admin=") + 6, token.indexOf(","));
    React.useEffect(()=>{

    axios.post('http://localhost:1337/users', {
        headers: {
            Authorization: `Bearer ${token1}`,
        },
    })
        .then(response => {
            console.log(response.data)
        })
        .catch(error => {
            // Handle error.
            console.log('An error occurred:', error.response);
        });

    },[])

    return (
        <div className={classes.search}>
            <h2 className={classes.title}>USER</h2>
            <SearchInput />
            <DataTableUser/>
        </div>
    );
}
